import React from 'react';
import axios from 'axios'

const WhitelistPage = ({whitelist}) => {
    console.log(whitelist)
	return (
		<div>
			{}
		</div>
	);
};

WhitelistPage.getInitialProps = async ({req, res}) => {
    const result = await axios.get('http://localhost:8000/whitelist')
    return {whitelist: result.data}
}

export default WhitelistPage;
